const int SIZE = 500009; //any prime number - size of hash vector
const int m = 100;//max number length

vector<ll> precalcHash(m); // precalculated hash multiplier - 11^i; i = 1:m
vector<set<ll>> HashCodes(SIZE+1); // hash code and value to avoid collisions

//calculates number hash code for O(number.size())
ll calculateHash(ll num)
{
    ll hash = 0;
    int index = 0;
    while (num)
    {
        hash += (num % 10 + 1) * precalcHash[index];
        num = num >> 1;
        ++index;
    }
    return abs(hash % SIZE); // return abs module of hashes vector size to fin in
}

//return true if where is the same number 
//work for O(number.size() + log(c)), where c is amount of collisions for the number hash
bool checkNumber(ll num)
{
    ll numHash = calculateHash(num);
    return HashCodes[numHash].find(num) == HashCodes[numHash].end() ? false : true;
}

